import React from "react";
import Container from "react-bootstrap/Container";
import CarouselBrands from "./sub_components/CarouselBrands";
import Button from "react-bootstrap/Button";


const Home = (props) => {
    return (
        <section id="home">

            <div className="banner-hotline">
                <img className="banner-image" src="/images/desktop.aadf6093.jpg" alt="" />
            </div>

            <div className="carousel-brands">
                <Container>
                    <h1>As Seen On</h1>
                    <CarouselBrands />
                </Container>
            </div>

            <div className="home-content">
                <Container>
                    <h1>Full of Flavour, not sugar</h1>
                    <h3>Full-fat cream is the foundation of our Old-World recipe and why we have the lowest possible sugar.</h3>
                    <Button variant="primary">
                        Subscribe
                    </Button>
                </Container>
            </div>


        </section>
    );
};


export default Home;
